import { Landing } from './Components/Login.js';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import {
  MDBInputGroup,
  MDBInputGroupText,
  MDBInputGroupElement
} from 'mdb-react-ui-kit';


function App() {
  return (
    <MDBContainer className="border border-primary mt-5">er>
      <Router>
        <Switch>
          <Route path="/">
            <Landing />
          </Route>
        </Switch>
      </Router>
    </MDBContainer>
  );
}

export default App;
